import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import './dist/css/bootstrap.min.css';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            Title : "Laporan Praktikum Web Design : CSS",
            Nama : "Adam Arthur Faizal",
            NIM : "M3119001",
            Kelas : "TI A 2019"
        }
    }
    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <h1 className="font-weight-bold">{this.state.Title}</h1>
                    <h3>{this.state.Nama}</h3>
                    <h4>{this.state.NIM} - {this.state.Kelas}</h4>
                    <h4 className="font-weight-bold">Modul CSS</h4>
                </header>
            </div>
        );
    }
}

export default App;
